package com.demo1.LeedCode.Hash;

import java.util.HashMap;
import java.util.Set;

public class leedcode242 {
    public static void main(String[] args) {
        String s = "";
        String t = "";
        System.out.print(isAnagram(s, t));
    }
    public static boolean isAnagram(String s, String t){
        if(s.length()!=t.length()){
            return false;
        }
        HashMap<String, Integer> hms = new HashMap<>();
        HashMap<String, Integer> hmt = new HashMap<>();
        for(int i = 0; i<s.length();i++){
            if(hms.containsKey(String.valueOf(s.charAt(i)))==true){
                int count =  hms.get(String.valueOf(s.charAt(i)));
                count++;
                hms.put(String.valueOf(s.charAt(i)),count);
            }else{
                hms.put(String.valueOf(s.charAt(i)),1);
            }

            if(hmt.containsKey(String.valueOf(t.charAt(i)))==true){
                int count =  hmt.get(String.valueOf(t.charAt(i)));
                count++;
                hmt.put(String.valueOf(t.charAt(i)),count);
            }else{
                hmt.put(String.valueOf(t.charAt(i)),1);
            }

        }
        Set<String> set_s = hms.keySet();
        Set<String> set_t = hmt.keySet();
        if(set_t.size()!=set_s.size()){
            return false;
        }
        boolean flag = true;
        for(String str:set_s){
            if(hmt.containsKey(str) && (int)hmt.get(str)==(int)hms.get(str)){
                continue;
            }else{
                flag = false;
                break;
            }
        }
        return flag;
    }
}
